from PyQt5 import QtWidgets as qtwclass NamelistStack(qtw.QFrame):    def __init__(self, default_par):        super().__init__()        self.default_par = default_par        self.InitStackUI()    def InitStackUI(self):        stack = qtw.QStackWidget()        for namelist in self.default_par.namelists:            stack.addItem(namelist.name)           layout = qtw.QVBoxLayout()        layout.addWidget(stack)        self.setLayout(layout)                